import React from 'react';
import SeasonDisplay from "./SeasonDisplay";
import ReactDOM from 'react-dom';

class App extends React.Component {
    render() {
        <SeasonDisplay />;

        return <div>Latitude: </div>
    };
};


ReactDOM.render(<App />, document.getElementById('root'));
